import Navitage from "../Modules/navigate"
import Searchbox from "../Modules/searchbox"
import styless from "./mainPage.module.css"

function MainPage() {
    return (
        <div>
            <div className={styless.Searchbox_position}>
                <Searchbox />
            </div>
            <div>
                <Navitage />
            </div>
        </div>
    )
}
export default MainPage;
